import React, { useState } from "react";
import {
  TextField,
  Button,
  Container,
  Typography,
  Box,
  IconButton,
  InputAdornment,
  Divider,
  FormControl,
  InputLabel,
} from "@mui/material";
import { Visibility, VisibilityOff } from "@mui/icons-material";
import Logo from "../../assets/logo.png";
import { LoginTitle } from "./style";

const LoginForm = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [showPassword, setShowPassword] = useState(false); // State to toggle password visibility
  const [error, setError] = useState("");

  const handleClickShowPassword = () => {
    setShowPassword((prevState) => !prevState);
  };

  return (
    <Container>
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <img src={Logo} />
        <LoginTitle>Login</LoginTitle>
        <Divider />
        <form>
          <label className="formLable">
            Email Id<span>*</span>
          </label>
          <FormControl variant="standard" className="inputfield">
            <TextField
              fullWidth
              variant="filled"
              onChange={(e) => setEmail(e.target.value)}
              sx={{
                "& .MuiInput-underline:before": {
                  borderBottom: "none", // Remove the underline (bottom border)
                },
                "& .MuiInput-underline:hover:before": {
                    borderBottom: "none", // Remove the underline on hover
                },
              }}
            />
          </FormControl>
          <FormControl variant="standard" className="inputfield">
            <label className="formLable">
              Password<span>*</span>
            </label>
            <TextField
            variant="filled"
              type={showPassword ? "text" : "password"} // Toggle password visibility
              fullWidth
              onChange={(e) => setPassword(e.target.value)}
              sx={{
                "& .MuiInput-underline:before": {
                  border: "none", // Remove the underline (bottom border)
                },
                "& .MuiInput-underline:hover:before": {
                  border: "none", // Remove the underline on hover
                },
              }}
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton onClick={handleClickShowPassword} edge="end">
                      {showPassword ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                  </InputAdornment>
                ),
              }}
            />
          </FormControl>
          <Button type="submit" variant="contained" fullWidth>
            Login
          </Button>
        </form>
      </Box>
    </Container>
  );
};

export default LoginForm;
